// import styles of this component
import styles from "./Nav.module.css"

// import other components
import Button from "../Elements/Button/Button"

// import other react pkg to use
import { HambergerMenu } from "iconsax-react"
import { getUser, login } from "../../helpers/auth_helper"
import { useState } from "react"

// Nav component
const Nav = () => {

    const [loggedInUser, setLoggedInUser] = useState();

    function onLogin() {
        login();
    }

    function onGetLoggedInUser() {
        getUser().then(user => {
            console.log("haha");
            console.log(user)
            if (user) {
                setLoggedInUser(user);
            }
        });

    }


    console.log(loggedInUser);
    return (
        <nav className={`${styles.nav} flex align-items-center`}>
            <h1 className={styles["nav-title"]}>CAPNEWS</h1>
            <ul className={`flex align-items-center ${styles["navbar-nav"]}`}>
                <li className={`${styles["nav-item"]} ${styles.active}`}>
                    <a href="" className={styles["nav-link"]}>Home</a>
                </li>
                <li className={styles["nav-item"]}>
                    <a href="" className={styles["nav-link"]}>Explore</a>
                </li>
                <li className={styles["nav-item"]}>
                    <a href="" className={styles["nav-link"]}>Artists</a>
                </li>
            </ul>
            <div className={`flex ${styles["navbar-buttons"]}`}>
                <Button theme="transparent" onClick={onLogin}>Login</Button>
                <Button theme="matrix" onClick={onGetLoggedInUser}>Sign up</Button>
            </div>
            <div className={styles["navbar-responsive-menu"]}>
                <Button theme="transparent">
                    <HambergerMenu size="32" color="var(--white-100)" />
                </Button>
            </div>
        </nav>
    )
}

export default Nav
